import * as React from 'react';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';

export default function DisabledOptions() {
  return (
    <>
        <Box>
            <Paper elevation={6} sx={{
                display: 'flex',
                justifyContent: 'space-around',
                placeItems: 'center',
                width: '100%',
                height: 100,
            }}>
                <Autocomplete
                    id="beg-hour"
                    options={timeSlots}
                    sx={{ width: 125 }}
                    renderInput={(params) => <TextField {...params} label="Inicio" />}
                />
                <Autocomplete
                    id="end-hour"
                    options={timeSlots}
                    sx={{ width: 125 }}
                    renderInput={(params) => <TextField {...params} label="Final" />}
                />
                <Autocomplete
                    disablePortal
                    id="day-input"
                    options={weeksDays}
                    sx={{ width: 160 }}
                    renderInput={(params) => <TextField {...params} label="Día" />}
                />
                <Autocomplete
                    disablePortal
                    id="mon-input"
                    options={yearsMonths}
                    sx={{ width: 160 }}
                    renderInput={(params) => <TextField {...params} label="Mes" />}
                />
            </Paper>
        </Box>

    </>
  );
}

// One time slot every hour.
const timeSlots = Array.from(new Array(24)).map(
  (_, index) =>
    `${index < 10 ? '0' : ''}${Math.floor(index)}:${'00'}`,
);

// Week's days
const weeksDays = [
  { label: 'Lunes' },
  { label: 'Martes' },
  { label: 'Miercoles' },
  { label: 'Jueves' },
  { label: 'Viernes' },
  { label: 'Sábado' },
  { label: 'Domingo' },
];

// Year's months
const yearsMonths = [
    { label: 'Enero' },
    { label: 'Febreo' },
    { label: 'Marzo' },
    { label: 'Abril' },
    { label: 'Mayo' },
    { label: 'Junio' },
    { label: 'Julio' },
    { label: 'Agosto' },
    { label: 'Setiembre' },
    { label: 'Octubre' },
    { label: 'Noviembre' },
    { label: 'Diciembre' },
];
